@RPeigney Bonsoir @RPeigney, merci de nous contacter sur Twitter.
Afin de vous aider à réserver votre billet, merci de nous préciser par DM votre parcours, dates de voyage, vols choisis, ainsi que le nombre de voyageurs.
Nous restons à votre écoute.

@danoo77711 Ce montant est susceptible d’évoluer selon les disponibilités. 
Vous trouverez ces informations via ce lien : [LIEN]
Nous restons disponibles si besoin et nous vous souhaitons une bonne journée.

@nanoulafe @nanoulafe Nous regrettons qu’une panne technique vous ait empêché de profiter des distractions attendues.
Nous vous invitons à effectuer une réclamation auprès de notre Service Client ici : [LIEN]
